        while (n > 0) {
            if (n % 3 == 0) {
                power *= 3;
            }
            n /= 3;
        }
        return power == 1;
    }

    public static void main(String[] args) {
        System.out.println(isPowerOfThree(27)); // Output: true
        System.out.println(isPowerOfThree(0));    // Output: false
        System.out.println(isPowerOfThree(-1));    // Output: false
    }
}
```

### Explanation:

1. **Initial Check**: If \( n \) is less than 0, return `false` immediately.
2. **Initialization**: We initialize `power` to 1, as any number can be expressed as \( 3^1 \).
3. **Loop Until Divisibility by 3**: We use a while loop to repeatedly divide \( n \) by 3 until \( n \) is no longer divisible by 3.
4. **Divisibility by 3**: If \( n \) is divisible by 3, then \( 3^x \) will be a multiple of 3 and we can stop the loop.
5. **Check the Power**: If \( 3^x \) is 1, then \( n \) is a power of 3.

This approach ensures that we find the solution efficiently without using loops or recursion.

